INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("ふむ、よい趣向ですね。\n敬うべき相手を忘れず、恩を忘れず、\n健勝を祝う宴を開く……\n礼節を弁えた人間は好きですよ。", 107011, 11, 1070501040, 0, 1, 1070501, 1, 4, "", 0);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("", 0, 91, 1070501041, "", "", 1070501, "", "", "", "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("vo_adv_1070501_001", "vo_adv_1070501", 21, 1070501042, "", "", 1070501, 0, 0, "", "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("しかし一時には\n赤子同然だった貴方が\nここまで成長したこと……\nとても喜ばしく思います。", 107011, 11, 1070501043, 0, 1, 1070501, 1, 5, "", 0);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("", 0, 91, 1070501044, "", "", 1070501, "", "", "", "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("vo_adv_1070501_002", "vo_adv_1070501", 21, 1070501045, "", "", 1070501, 0, 0, "", "");
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("ただ、そうですね……\n厚意に預かるばかり、\nというのも性に合いませんし。\n何かご褒美をあげましょう。", 107011, 11, 1070501046, 0, 1, 1070501, 1, 5, "", 0);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("", 0, 91, 1070501047, "", "", 1070501, "", "", "", "");
