INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("焦って決めずとも構いません。\n今日は一日、私が飽きるまで\n貴方に付き合ってもらう予定ですから。\nふふ……期待していますよ？", 107011, 11, 1070501049, 0, 1, 1070501, 1, 5, "", 0);
